import React, { useState } from 'react';

const NewQuote = ({ user }) => {
  const [quoteItems, setQuoteItems] = useState([]);

  const handleAddItem = () => {
    setQuoteItems([...quoteItems, { name: '', price: 0 }]);
  };

  const handlePriceChange = (index, value) => {
    const updated = [...quoteItems];
    updated[index].price = parseFloat(value);
    setQuoteItems(updated);
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">New Quote</h1>
      <button onClick={handleAddItem} className="mb-4 px-4 py-2 bg-blue-600 text-white rounded">Add Item</button>
      <div className="space-y-2">
        {quoteItems.map((item, index) => (
          <div key={index} className="flex gap-2">
            <input
              type="text"
              placeholder="Item Name"
              className="border p-2 flex-1"
              value={item.name}
              onChange={(e) => {
                const updated = [...quoteItems];
                updated[index].name = e.target.value;
                setQuoteItems(updated);
              }}
            />
            <input
              type="number"
              placeholder="Price"
              className="border p-2 w-32"
              value={item.price}
              onChange={(e) => handlePriceChange(index, e.target.value)}
            />
          </div>
        ))}
      </div>
    </div>
  );
};

export default NewQuote;
